import React, { Component } from 'react';

export default class HomeA extends Component {
  render() {
    return (
      <>
      <div className="Woola_about-banner main-banner">
	<h3> About Us</h3>
</div>
   
    <HomeB />
    </>
    );
  }
}

class HomeB extends React.Component{
  render() {
    return (
     <>
        <div className="eco-friend">
	<div className="container">
		<div className="row">
			<div className="col-md-6 aos-init aos-animate" data-aos="fade-right">
				<h2> Welcome to New Zealand, land of the long white cloud</h2>
				<p>Here in New Zealand, we are striving to keep our country green, sustainable, and beautiful. We found an increasing desire for products made from natural products that were sustainably sourced. From this Woola was born. Starting with pillows the range quickly grew to include mattresses, bases, duvets, and overlays. We export this range right across the globe.  </p>
		
			</div>
			<div className="col-md-6 aos-init aos-animate" data-aos="fade-left">
           
				<img src="https://www.woola.co.nz/wp-content/uploads/2021/05/eco-bne-1.png"/> 
				<div className="cust_about_video">
				<span className="wistia_embed wistia_async_aw9js8lbi2 popover=true popoverAnimateThumbnail=true popoverContent=link videoFoam=true wistia_embed_initialized" style="display:inline;position:relative" id="wistia-aw9js8lbi2-1"><div id="wistia_72.thumb_container" class="wistia_click_to_play" style="position: relative; display: inline;">
                       <a className="" href="#"><img src="https://www.woola.co.nz/wp-content/uploads/2021/05/Group-13892.png"/></a> 
                   </div></span>
               </div>
			</div>
		</div>
	</div>
</div>
      </>
    );
  }
}
